description:
Audience shot

1. Intro (Anton Reemcomb try to get techno-band Prestige to replace GWAR. Prestige play for 3 min)
2. Ham on the Bone (GWAR burst through speakers and kill Prestige)
3. Ollie North (Security guard is disemboweled)
4. Pure as the Arctic Snow
5. The Salaminizer
6. Blimey (Mic-tester's arms are ripped off)
7. U Ain't Shit (Cop tries to stop show. Gets impaled and carried off like a spit)
8. The Years Without Light (Crap-a-pault)
9. Gilded Lilly (Slymenstra disciplines Techno, a.k.a &quot;Toilet Slave&quot;)
10. Rock 'n' Roll Never Felt So Good (Quadraplechick is raped and dismembered)
11. Horror of Yg
12. Voodo Summoning (Slymenstra does fire dance)
13. Captain Crunch (Techno puts slaves in Mind Control helmets, and get them to bring back his arm)
14. The Private Pain of Techno Destructo
15. Gor Gor (Gor Borg, controlled by Techno via remote control, comes out. Slymenstra steals remote and turns Gor Borg against Techno. GWAR Letters fall on Gor Borg and kill it)
16. America Must Be Destroyed

Encore :
17. Slaughterama (Presidential Version)
18. Sick of You

